import { AuthBox, BgImg, CancelIcon, Wrap } from '../../styles/auth/auth.styles';

const JoinPage = () => {
  return (
    <>
      <BgImg>
        <Wrap>
          <CancelIcon></CancelIcon>
          <AuthBox>
            <h1>회원가입</h1>
          </AuthBox>
        </Wrap>
      </BgImg>
    </>
  );
};

export default JoinPage;
